n = int(input())
m = int(input())
answer = ""
for i in range(0, n):
    if i % 2 == 0:
        for j in range(i * m, (i + 1) * m):
            answer += (3 - len(str(j))) * " " + str(j)
        answer += '\n'
    else:
        for j in range((i + 1) * m - 1, i * m - 1, -1):
            answer += (3 - len(str(j))) * " " + str(j)
        answer += '\n'
print(answer)

