int R = 0;
int C = 0;
int Scelta = 0;
int Cont =0;

System.out.println("Operazione n.1-Aggiungi contatto; Operazione n.2-Cerca contatto; Operazione n.3-Elimina contatto; Operazione n.4-Chiudi rubrica;");
Scelta = Integer.parseInt(System.console().readLine("Quale operazione vuoi eseguire? Digita un numero: "));

String [][] Rubrica = new String[R][C];

while(Scelta!=4){
if(Scelta==1){

String nome = System.console().readLine("Scrivi il nome del contatto: "));
C++;
Rubrica[R][C] = nome;
String tel = System.console().readLine("Scrivi il numero: ");
Rubrica[R][C] = tel;
R++;
}
if(Scelta==2){
String CercaNome = new String (System.console().readLine("Inserisci il nome da cercare: "));
while((Cont<R)&&(CercaNome!=Rubrica[0][Cont])){
Cont++;
}
if(CercaNome==Rubrica[Cont][0]){
System.out.println(Rubrica[Cont][0] + Rubrica[Cont][1]);
}
else{
System.out.println("Contatto non trovato.");
}
}
if(Scelta==3){
String CercaNome = new String (System.console().readLine("Inserisci il contatto da eliminare: "));
if(CercaNome==Rubrica[Cont][0])
