class APlayerCameraManager : public AActor
{
public:
	
	FTViewTarget Get_ViewTarget()
	{
		static int32_t g_pOffset = NULL;

		if (!g_pOffset)
			g_pOffset = UObject::FindOffset(ENCRYPT("Class Engine.PlayerCameraManager"), ENCRYPT("ViewTarget"));

		return *reinterpret_cast<FTViewTarget*>((uintptr_t)this + g_pOffset);

	}

	static UClass* StaticClass()
	{
		static UClass *ptr = nullptr;
		if (!ptr)
			ptr = UObject::FindClass(ENCRYPT("Class Engine.PlayerCameraManager"));
		return ptr;
	}
};

class APlayerController : public AController
{
public:
	APlayerCameraManager* Get_PlayerCameraManager()
	{
		static int32_t g_pOffset = NULL;

		if (!g_pOffset)
			g_pOffset = UObject::FindOffset(ENCRYPT("Class Engine.PlayerController"), ENCRYPT("PlayerCameraManager"));

		return *reinterpret_cast<APlayerCameraManager**>((uintptr_t)this + g_pOffset);

	}

	bool WorldToScreen(Vector3 WorldPosition, Vector2* vScreenPosOne)
	{
		if (!Memory::IsValidPointer<APlayerController>(this))
			return false;

		if (!Memory::IsValidPointer<APlayerCameraManager>(this->Get_PlayerCameraManager()))
			return false;
	
		Vector2 DisplaySize = Vector2(Scene::GetInstance()->g_pDraw->GetWidth(), Scene::GetInstance()->g_pDraw->GetHeight());

		FRotator Rotation = this->Get_PlayerCameraManager()->Get_ViewTarget().POV.Rotation;

		
		MATRIX tempMatrix = Matrix(Rotation);

		Vector3 vAxisX, vAxisY, vAxisZ;

		vAxisX = Vector3(tempMatrix.m[0][0], tempMatrix.m[0][1], tempMatrix.m[0][2]);
		vAxisY = Vector3(tempMatrix.m[1][0], tempMatrix.m[1][1], tempMatrix.m[1][2]);
		vAxisZ = Vector3(tempMatrix.m[2][0], tempMatrix.m[2][1], tempMatrix.m[2][2]);

		Vector3 vDelta = WorldPosition - this->Get_PlayerCameraManager()->Get_ViewTarget().POV.Location;

		Vector3 vTransformed = Vector3(vDelta.Dot(vAxisY), vDelta.Dot(vAxisZ), vDelta.Dot(vAxisX));

		if (vTransformed.z < 1.f)
			return false;

		float FovAngle = this->Get_PlayerCameraManager()->Get_ViewTarget().POV.FOV;
		float ScreenCenterX = (DisplaySize.x / 2.f);
		float ScreenCenterY = (DisplaySize.y / 2.f);

		vScreenPosOne->x = ScreenCenterX + vTransformed.x * (ScreenCenterX / std::tanf(FovAngle * M_PI / 360.f)) / vTransformed.z;
