  buono info;
  nodo*next;
};

nodo* creaNodo(buono b){
  nodo* n = new nodo;
  if(n == NULL) {
    return NULL;
  }
  else{
    n->info = b;
    n->next = NULL;
  }
}

nodo* inserimentoTesta(nodo* lista, nodo* n){
  if(lista == NULL) return n;
  if (n == NULL) return lista;
  n->next = lista;
  return n;
}

void stampaLista(nodo* lista){
  if(lista != NULL){
    cout<<"ID : "<<(lista->info).id;
    stampaLista(lista->next);
  }
}

