I AM WORLDEDIT AND SO CAN YOU! - AN INTRO TO WORLDEDIT

Wooden axes allow you to make selections of an area to copy, paste, and otherwise manipulate. Left click with a wood axe to set one corner of a box, and right click will set the opposite corner. Once you've done that you have a rectangular selection. Useful selection commands are:

//copy - Copies the selection allowing you to paste it in later

//paste - Pastes the selection in

//rotate [90/180/270] - Great for making hallways and the like, spin a copied selection around before placing it back down

//set [block] - Fills the entire selection with a single block. You can use either block id or block name for this. If you want a data value, separate it with a colon. For example, 1:5 or stone:5 gives you andesite.

//replace [oldblock] [newblock] - Like set, but will only replace specific blocks from your selection. Great if you want to change a block palette.
-
In addition to making selections, brushes are the other most important part of Worldedit. A brush can be applied to any item (not block); I like to use different colored swords to keep track of what I'm using. The command is

/brush sphere [block/s] [radius]

A simple example is //brush sphere air 5. Right-clicking with this will carve out a 5 block radius of air, perfect for making tunnels and caves. However, if we do that with stone, it makes a giant blob. What we can instead do is add a mask command so it will only paint specific blocks, like so:

/brush sphere 1:5 4
/mask stone

This will paint any stone near where you click into andesite (stone has id 1, andesite is the 5th stone type, thus 1:5). You can add multiple items in a mask by separating with commas (/mask stone,glowstone), useful for erasing mistakes and keeping stuff consistent. Finally, WorldEdit gives you a simple way to do block variation by allowing you to paint with multiple blocks at once:

/brush sphere 66%4,33%1:5,1%glowstone 6 

Every time this brush places a block, that block has a 66% chance of being block #4 - cobblestone, a 33% chance of being andesite, and a 1% chance of being glowstone. These weights are easily adjusted, can handle as many blocks as you want, and can even be used in the //set and //replace commands from earlier.

