static bool CzyLitera(char a)
        {
            if (a >= 'A' && a <= 'Z')
            {
                return true;
            }
            if (a >= 'a' && a <= 'z')
            {
                return true;
            }
            return false;
        }

        static int LicznikWyrazow(string tekst)
        {
            int licznik = 0;
            if (tekst.Length == 0)
            {
                return 0;
            }
            for (int i = 0; i < tekst.Length; i++)
            {
                if (CzyLitera(tekst[i]))
                {
                    for (int j = i; j < tekst.Length; j++)
                    {
                        if (CzyLitera(tekst[j]) && j == tekst.Length-1)
                        {
                            licznik++;
                            i = j;
                            break;
                        }
                        if (CzyLitera(tekst[j]) && CzyLitera(tekst[j+1]) == false)
                        {
                            licznik++;
                            i = j;
                            break;
                        }
                    }
                }
            }
            return licznik;
        }
        
        static string[] ZwrocWyrazy(string tekst)
        {
            string[] T = new string[LicznikWyrazow(tekst)];
            int j = 0;
            string wyraz = "";
            for (int i = 0; i < tekst.Length+1; i++)
            {
                if (i == 0 && CzyLitera(tekst[i]) == false)
                {
                    i++;
                }
                if (i == tekst.Length && CzyLitera(tekst[i-1]) == false)
                {
                    break;
                }
                if (i == tekst.Length)
                {
                    T[j] = wyraz;
                    break;
                }
                if (CzyLitera(tekst[i]) == false && CzyLitera(tekst[i-1]))
                {
                    T[j] = wyraz;
                    wyraz = "";
                    j++;
                }
                if (CzyLitera(tekst[i]))
                {
                    wyraz += tekst[i];
                }
            }
            return T;
        }

        static int IleWyrazow(string tekst,char x)
        {
            int licznik = 0;
            int licznik_wyrazow = 0;
            string[] tab = ZwrocWyrazy(tekst);
            for (int i = 0; i < tab.Length; i++)
            {
                for (int j = 0; j < tab[i].Length; j++)
                {
                    if (tab[i][j] == x)
                    {
                        licznik++;
                    }
                }
                if (licznik >= 2)
                {
                    licznik_wyrazow++;
                }
                licznik = 0;
            }
            return licznik_wyrazow;
        }

