#include <iostream>
#include <ctime>
using namespace std;

const int COLUMN = 5;
const int MAXROW = 5;

void showMat(double a[][COLUMN], int r)
{
	// zuerst eine Freizeile
	std::cout << std::endl;

	// zeilen durchgehen
	for (int i = 0; i < r; i++)
	{
		// pro Zeile ganze Spalte
		for (int j = 0; j < COLUMN; j++)
		{
			cout << a[i][j] << " ";
		}
		// nächste Zeile
		std::cout << std::endl;
	}

}


int main()
{
	int r;

	srand(time(0)); // initialize random [number] generator
	// zuerst Zeile, dann Spalte
	double a[MAXROW][COLUMN];
	double b[MAXROW][COLUMN];
	double sum[MAXROW][COLUMN];
	double diff[MAXROW][COLUMN];
	int i;
	int j;


	cout << "Geben Sie eine Anzahl fuer die Zeilen der Matrix an: " << endl;
	cin >> r;
	//         hier aus , ein || gemacht
	if (r < 0 || r > MAXROW)
	{
		cout << "Geben Sie eine Zahl an, die zwischen 0 und 5 liegt: " << endl;
		cin >> r;
	}

	// zeilen durchgehen
	for (i = 0; i < r; i++)
	{
		// pro Zeile ganze Spalte
		for (j = 0; j < COLUMN; j++)
		{
			a[i][j] = rand() % 20;
			b[i][j] = rand() % 20 + 30;

			// summe bilden
			sum[i][j] = a[i][j] + b[i][j];

			// differenz
			diff[i][j] = a[i][j] - b[i][j];
		}
	}

	// nun alle 4 anzeigen

	showMat(a, r);
	showMat(b, r);
	showMat(sum, r);
	showMat(diff, r);


	return 0;
}

