pub struct Hv507<SPI, AdcOneShot, AdcPin, PolOutputPin>
{
    /// Output GPIO 
    pol: RefCell<PolOutputPin>,
    /// SPI bus for writing out to shift register
    spi: RefCell<SPI>,
    /// ADC for reading current sense
    adc: RefCell<AdcOneShot>,
    adc_channel: RefCell<AdcPin>,
}

impl <SPI, AdcOneShot, ADC, AdcPin, PolOutputPin, SpiError, PinError, AdcError> 
Hv507<SPI, AdcOneShot, AdcPin, PolOutputPin> 
where
    SpiError: core::fmt::Debug,
    PinError: core::fmt::Debug,
    AdcError: core::fmt::Debug,
    AdcOneShot: emhal::adc::OneShot<ADC, u16, emhal::adc::Channel<ADC, ID=u8>, Error = AdcError>,
    SPI: emhal::blocking::spi::Write<u8, Error = SpiError>,
    AdcPin: emhal::adc::Channel<ADC, ID = u8>,
    PolOutputPin: emhal::digital::v2::OutputPin<Error = PinError>,
{
    pub fn new(spi: SPI, adc: AdcOneShot, adc_channel: AdcPin, pol: PolOutputPin,) -> 
        Hv507<SPI, AdcOneShot, AdcPin, PolOutputPin> 
    {
        Hv507 { 
            spi: RefCell::new(spi),
            adc: RefCell::new(adc),
            adc_channel: RefCell::new(adc_channel),
            pol: RefCell::new(pol),
        }
    }
}

