#include<iostream>
#include<string>
#include<fstream>
using namespace std;
class cnode
{
public:
	int frequency;
	char name[256];
	string encryption;
	cnode *pnext;
	cnode *pleft = NULL;;
	cnode *pright = NULL;
	cnode *pdown = NULL;
};
class clist
{
public:
	cnode *phead;
	cnode *ptail;

	clist()
	{
		phead = NULL;
		ptail = NULL;
	}

	~clist()
	{
		cnode *ptrav = phead;
		while (ptrav != NULL)
		{
			phead = phead->pnext;
			delete ptrav;
			ptrav = phead;
		}
	}

	void Attach(cnode *pnn)
	{
		if (phead == NULL)
		{
			phead = pnn;
			ptail = pnn;
		}
		else
		{
			ptail->pnext = pnn;
			ptail = pnn;
		}
	}

	void sortAttach(cnode *pnn)
	{
		cnode *pB = NULL;
		cnode *ptrav = phead;
		while (ptrav != NULL)
		{
			if (ptrav->frequency > pnn->frequency)
			{
				break;
			}
			pB = ptrav;
			ptrav = ptrav->pnext;
		}
		if (ptrav != NULL)
		{
			if (pB != NULL)
			{
				pB->pnext = pnn;
				pnn->pnext = ptrav;
			}
			else
			{
				pnn->pnext = ptrav;
				phead = pnn;
			}
		}
		else
		{
			pB->pnext = pnn;
			pnn->pnext = NULL;
		}
	}

	void combine(cnode *pnn, cnode *ptrav)
	{
		cnode *pnn2;
		pnn2 = new cnode;
		cnode *tnext;
		cnode *tdown;
		tdown = new cnode;
		tnext = pnn->pnext;
		pnn2->frequency = pnn->frequency + tnext->frequency;
		int k = 0;

		//copy name pnn
		for (int i = 0; i < 256; i++)
		{
			if (pnn->name[i] != '\0')
			{
				pnn2->name[k] = pnn->name[i];
				k++;
			}
			else
			{
				break;
			}

		}

		//copy name pnext
		for (int i = 0; i < 256; i++)
		{
			if (tnext->name[i] != '\0')
			{
				pnn2->name[k] = tnext->name[i];
				k++;
			}
			else
			{
				break;
			}
		}

		//make rest of array null
		pnn2->name[k] = '\0';

		//set tdown
		for (int i = 0; pnn2->name[i]!='\0'; i++)
		{
			tdown->name[i] = pnn2->name[i];
		}
		tdown->frequency = pnn2->frequency;


		//set tree
			//check pnn
		if (pnn->pdown != NULL)
		{
			tdown->pleft = pnn->pdown;
		}
		else
		{
			tdown->pleft = pnn;
		}

		//check tnext
		if (tnext->pdown != NULL)
		{
			tdown->pright = tnext->pdown;
		}
		else
		{
			tdown->pright = tnext;
		}

		pnn2->pdown = tdown;



		//sortAttach
		cnode *pB = NULL;
		while (ptrav != NULL)
		{
			if (ptrav->frequency > pnn2->frequency)
			{
				break;
			}
			pB = ptrav;
			ptrav = ptrav->pnext;
		}
		if (ptrav != NULL)
		{
			pB->pnext = pnn2;
			pnn2->pnext = ptrav;
		}
		else
		{
			pB->pnext = pnn2;
			pnn2->pnext = ptrav;
		}

	}

	void binsearch(cnode *pnn)
	{
		cnode *ptrav;
		string bin;
		int flag = 0;
		ptrav = pnn;
		cout << "input binary" << endl;
		cin >> bin;
		for (int i = 0; i < bin.length(); i++)
		{
			if (ptrav != NULL)
			{
				if (bin[i] == '0')
				{
					ptrav = ptrav->pleft;
				}
				else
				{
					if (bin[i] == '1')
					{
						ptrav = ptrav->pright;
					}
					else
					{
						flag = 1;
						break;
					}
				}
			}
			else
			{
				break;
			}
		}
		cout << endl << "-------------------------------" << endl;
		if (ptrav != NULL && flag==0)
		{
			for (int i = 0; i < 256; i++)
			{
				if (ptrav->name[i] != ' ')
				{
					cout << ptrav->name[i];
				}
				else
				{
					break;
				}
			}
			cout << " : " << ptrav->frequency << endl;
		}
		else
		{
			cout << "node not found" << endl;
		}

	}

	void searchBin(cnode *pnn)
	{
		cnode *ptrav;
		ptrav = pnn;
		char code[1];
		int flag = 0;
		cin >> code[0];
		while (ptrav->pleft != NULL && ptrav->pright != NULL)
		{
			for (int i = 0; i < 256; i++)
			{
				if (ptrav->pleft->name[i] == code[0])
				{
					ptrav = ptrav->pleft;
					break;
				}
				if (ptrav->pright->name[i] == code[0])
				{
					ptrav = ptrav->pright;
					break;
				}
			}

		}
		pnn = ptrav;
		for (int i = 0; i < 256; i++)
		{
			if (pnn->name[i] != ' ')
			{
				cout << pnn->name[i];
			}
			else
			{
				break;
			}
		}
		cout << " : " << pnn->frequency << endl;
	}

	void searchEnc(cnode *pnn, cnode *pnn2)
	{
		cnode *ptrav;
		ptrav = pnn;
		string encryption;
		char code[1];
		int flag = 0;
		code[0] = pnn2->name[0];
		while (ptrav->pleft != NULL && ptrav->pright != NULL)
		{
			for (int i = 0; i < 256; i++)
			{
				if (ptrav->pleft->name[i] == code[0])
				{
					ptrav = ptrav->pleft;
					encryption += '0';
					break;
				}
				if (ptrav->pright->name[i] == code[0])
				{
					ptrav = ptrav->pright;
					encryption += '1';
					break;
				}
			}
		}
		pnn = ptrav;
		for (int i = 0; pnn->name[i] != '\0'; i++)
		{
			if (pnn->name[i] != '\0')
			{
				cout << pnn->name[i];
			}
		}
		pnn2->encryption = encryption;
		cout << " : " << pnn2->frequency << " : " << pnn2->encryption << endl;
	}

};

int main()
{
