void material_setup(const vector<GLfloat> &a, const vector<GLfloat> &s,
                    const vector<GLfloat> &d) {
  GLfloat brightness = 20;
  glMatrixMode(GL_MODELVIEW);
  glPushMatrix();
  glEnable(GL_LIGHTING);
  glEnable(GL_NORMALIZE);
  glMaterialfv(GL_FRONT, GL_AMBIENT, a.data());
  glMaterialfv(GL_FRONT, GL_DIFFUSE, d.data());
  glMaterialfv(GL_FRONT, GL_SPECULAR, s.data());
  glMaterialf(GL_FRONT, GL_SHININESS, brightness);
}

void light_setup() {
  vector<GLfloat> ambient = {0.5, 0.5, 0.5, 1.0};
  vector<GLfloat> specular = {1.0, 1.0, 1.0, 1.0};
  vector<GLfloat> diffuse = {0.9, 0.9, 0.9, 1.0};
  vector<GLfloat> position = {20.0, 10.0, 30.0, 1.0};
  vector<GLfloat> second_position = {0.0, -20.0, 10.0, 1.0};

  glLightfv(GL_LIGHT0, GL_AMBIENT, ambient.data());
  glLightfv(GL_LIGHT0, GL_SPECULAR, specular.data());
  glLightfv(GL_LIGHT0, GL_DIFFUSE, diffuse.data());

  glLightfv(GL_LIGHT0, GL_POSITION, position.data());
  glEnable(GL_LIGHT0);

  glLightfv(GL_LIGHT1, GL_POSITION, second_position.data());
  glEnable(GL_LIGHT1);

  material_setup(ambient, specular, diffuse);
}

void display_textures() { light_setup(); }

void choose_display() {
  if (droid) {
    display_droid();
  } else if (texture) {
    display_textures();
  } else {
    display();
  }
}

void rotate_light(GLfloat x = 0, GLfloat y = 0) {
  GLfloat angle_x, angle_y;
  angle_x = light_x + x;
  angle_y = light_y + y;
  glRotatef(angle_x, 1.0, 0.0, 0.0);
  glRotatef(angle_y, 0.0, 1.0, 0.0);
}

void load_texture(string filename) {
  pimg = new jpg::Imagen(filename);
  x_size = pimg->tamX();
  y_size = pimg->tamY();
  texels = pimg->leerPixels();

  glGenTextures(1, textures);
  glBindTexture(GL_TEXTURE_2D, textures);
  gluBuild2DMipmaps(GL_TEXTURE_2D, GL_RGB, x_size, y_size, GL_RGB,
                    GL_UNSIGNED_BYTE, texels);
}

void enable_texture(string filename) {
  load_texture(filename);
  glEnable(GL_TEXTURE_2D);
  glBindTexture(GL_TEXTURE_2D, textures);
  glTexGeni(GL_S, GL_TEXTURE_GEN_MODE, GL_OBJECT_LINEAR);
  glTexGeni(GL_T, GL_TEXTURE_GEN_MODE, GL_OBJECT_LINEAR);
  glEnable(GL_TEXTURE_GEN_S);
  glEnable(GL_TEXTURE_GEN_T);
}

void fill_can(vector<double> &v, vector<unsigned long> &f) {
  vector<_vertex3f> tmp_vertex;
  vector<_vertex3i> tmp_faces;
  parse_vertex(v, tmp_vertex);
  parse_vertex(f, tmp_faces);
  vertex_can.push_back(tmp_vertex);
  faces_can.push_back(tmp_faces);
  v.clear();
  f.clear();
}

void create_can_object() {
  vector<double> input_vertex;
  vector<long unsigned> input_faces;
  _file_ply::read("data/lata-pinf.ply", input_vertex, input_faces);
