function onKeyDown(e){
    // var code=e.keyCode? e.keyCode : e.charCode;
    var code= e.which || e.keyCode;
    var alpha= Math.PI/32;
    switch(code)
    {
    case 38: // up
    case 73: // I
	rotationMatrix4=matrix4RotatedYZ(rotationMatrix4, alpha );
	break;
    case 40: // down
    case 75: // K
	rotationMatrix4=matrix4RotatedYZ(rotationMatrix4, -alpha );
	break;
    case 37: // left
    case 74:// J
	rotationMatrix4=matrix4RotatedXZ(rotationMatrix4, -alpha );
	break;
    case 39:// right
    case 76: // L
	rotationMatrix4=matrix4RotatedXZ(rotationMatrix4, alpha );
	break;
    case 70: // F
	moveVector[2]++;
	break;
    case 66: // B
    case 86: // V
	moveVector[2]--;
	break;
    case 32: // space
	rotationMatrix4= identityMatrix4;
    break;
    case 68:
        plot=sinxcosyBuffer
    break;
    case 83:
        plot=rippleBuffer;
    break;
    case 65:
        plot=pyrammidBuffer;
    break;
    
    }
    redraw();
}



