﻿using System;
 
namespace Fabryka_Platnosci
{
    class Program
    {
        //Enumeracja bankow platnosci
        public enum ERodzajPlatnosci
        {
            BANK_JEDEN,
            BANK_DWA
        }
 
        //Interface dla wszystkich bramek bankow
        public interface IBramkaPlatnosci
        {
            void DokonajPlatnosci(Produkt produkt);
        }
 
        //Typ produktu
        public class Produkt
        {
            public string Nazwa { get; set; }
            public string Opis { get; set; }
            public double Cena { get; set; }
 
        }
        //-----------------------------------------------------------------------------------------------------
        //-----------------------------------------------------------------------------------------------------
        //--------------------------------DEKLARACJA 2 BANKOW(sposobow platnosci)------------------------------
 
        public class BankJeden : IBramkaPlatnosci
        {
            public void DokonajPlatnosci(Produkt produkt)
            { 
                Console.WriteLine("Pierwszy rodzaj płatności VISA za {0}, kwota {1}", produkt.Nazwa, produkt.Cena);
            }
        }
 
        public class BankDwa : IBramkaPlatnosci
        {
            public void DokonajPlatnosci(Produkt produkt)
            {
                Console.WriteLine("Drugi rodzaj płatności MASTERCARD za {0}, kwota {1}", produkt.Nazwa, produkt.Cena);
            }
        }
        //--------------------------------------------------------------------------------------------------
        //--------------------------------------------------------------------------------------------------
 
 
        //Fabryka bramek
        //Tu deklaruje się instancje ktorej klasy maja byc wygenerowane do dokonania danej platnosci
        private class BramkaPlatnosciFabryka
        {
            public virtual IBramkaPlatnosci UtworzyBramkePlatnosci(ERodzajPlatnosci rodzaj)
            {
                IBramkaPlatnosci bramka = null;
                switch (rodzaj)
                {
                    case ERodzajPlatnosci.BANK_JEDEN:
                        bramka = new BankJeden();
                        break;
                    case ERodzajPlatnosci.BANK_DWA:
                        bramka = new BankDwa();
                        break;
                    default:
                        break;
                }
 
                return bramka;
 
            }
        }
 
        //API dla uzytkownika
        public class ProcesorPlatnosci
        {
            private IBramkaPlatnosci bramka;
 
            public void ProcesujPlatnosc(ERodzajPlatnosci rodzaj, Produkt produkt)
            {
                BramkaPlatnosciFabryka fabryka = new BramkaPlatnosciFabryka();
                this.bramka = fabryka.UtworzyBramkePlatnosci(rodzaj);
                this.bramka.DokonajPlatnosci(produkt);
            }
        }
 
 
        //----------------------------------------------------------------------------------------------
        //----------------------------------------------------------------------------------------------
        //----------------------------------------------------------------------------------------------
        static void Main(string[] args)
        {
            //Instancja klasy która dokonuje platnosci
            ProcesorPlatnosci procesorPlatnosci = new ProcesorPlatnosci();
            Produkt produkt = new Produkt();
 
            produkt.Nazwa = "MacBook 2020";
            produkt.Cena = 123654789;
            produkt.Opis = "Bardzo drogi laptop";
 
            Console.WriteLine("Koszyk zawiera \n{0}-{1} w cenie:{2}", produkt.Nazwa, produkt.Opis, produkt.Cena);
            Console.WriteLine("\nWybierz rodzaj platnosci:\n1.Bank milenium VISA \n2.Bank mBank MASTERCARD");
            int wybor = int.Parse(Console.ReadLine());
            procesorPlatnosci.ProcesujPlatnosc((ERodzajPlatnosci)wybor, produkt);
 
 
        }
    }
}

