package ku.piii2019.bl3;
 
import java.io.File;
import java.io.FileOutputStream;
import java.io.IOException;
import java.util.ArrayList;
import java.util.List;
import java.util.Scanner;
 
/**
 *
 * @author Ian
 */
public class CLI4 {
    public static void main(String[] args) throws IOException, Exception {
        Scanner myObj = new Scanner(System.in);
        System.out.println("Enter the input folder path");
        String inputPath = myObj.nextLine();
        System.out.println("Enter the total duration for your playlist (in seconds)");
        String durationString = myObj.nextLine();
        int duration = Integer.parseInt(durationString);
        System.out.println("Select the option to create relevant content:");
        System.out.println("1) artists");
        System.out.println("2) genres");
        String choice = myObj.nextLine();
        List<String> artists = new ArrayList<String>();
        List<String> genres = new ArrayList<String>();
        boolean stopInput = false;
        while (!stopInput) {
            if (choice.equals("1")) {
                System.out.println("Enter the artist name: ");
                String artist = myObj.nextLine();
                artists.add(artist);
                System.out.println("Do you want to enter more artists? (yes/no)");
            }
            if (choice.equals("2")) {
                System.out.println("Enter the genre name: ");
                String genre = myObj.nextLine();
                genres.add(genre);
                System.out.println("Do you want to enter more genres? (yes/no)");
            }
            String enterMore = myObj.nextLine();
            if(enterMore.equals("no"))
                stopInput = true;
        }
        File file = new File(inputPath);
        File[] listOfFiles = file.listFiles();
        String savedPlaylist = "";
        long currentDurationMilliseconds = 0;
        for(File f : listOfFiles){
            MediaItem m = new MediaItem();
            m.setAbsolutePath(f.getAbsolutePath());
            MediaInfoSourceFromID3 misf = new MediaInfoSourceFromID3();
            misf.addMediaInfo(m);
            if(choice.equals("1")){
                for(String artist : artists){
                    if(m.getArtist().toLowerCase().equals(artist.toLowerCase())){
                        if(currentDurationMilliseconds < duration*1000){
                            if(currentDurationMilliseconds + m.getLengthInMilliseconds() < duration*1000){
                                savedPlaylist = savedPlaylist + f.getAbsolutePath() + "\n";
                                currentDurationMilliseconds += m.getLengthInMilliseconds();
                            }
                        }
                    }
                }
            }
            if(choice.equals("2")){
                for(String genre : genres){
                    if(m.getGenre().toLowerCase().equals(genre.toLowerCase())){
                        if(currentDurationMilliseconds < duration*1000){
                            if(currentDurationMilliseconds + m.getLengthInMilliseconds() < duration*1000){
                                savedPlaylist = savedPlaylist + f.getAbsolutePath() + "\n";
                                currentDurationMilliseconds += m.getLengthInMilliseconds();
                            }
                        }
                    }
                }
            }
        }
        FileOutputStream out = new FileOutputStream(inputPath +"\\"+ "my-playlist.m3u");
        out.write(savedPlaylist.getBytes());
        out.close();
    }
}
